import React from 'react'
import ReactDOM from 'react-dom'

export default function MusicNote({black}){
	const fill = black ? 'black' : 'white'
	const stroke = black ? 'white' : 'black'

	return(
		<div style={{
        backgroundColor: fill,
        color: stroke,
        width: '100%',
        height: '100%'
      }}> 
			<img src = {process.env.PUBLIC_URL + 'music-note.png'} draggable = "true" onDragStart = {<h1> Hello </h1>}/>
		</div>)
}
